const LeftMenu = () => {
    return (
        <div style={{ position: 'absolute', paddingLeft: '40px' }}>
            <button>Найти по телефону</button>
            <button>Найти по имени</button>
            <button>Найти по адресу</button>
        </div>
    );
}

export default LeftMenu
